INSERT INTO `ad` (`id`, `accepted_id`, `advertiser_id`, `date`, `fk_time_id`, `limit`, `income`, `text`, `fk_category`, `status`, `fav_market`, `buyer_id`, `advertiserrate`, `buyerrate`, `entfernung`) VALUES
	(100, 0, 43, '2015-03-16', 2, 50, 5, 'Hallo,\r\nIch brauche einen Wocheneinkauf, also\r\n- Wurst\r\n- Käse\r\n- Bier\r\n- Brot\r\n- Wasser\r\n\r\nGenaueres per Nachricht...', 1, 1, 'Aldi', 42, 0, 0, 0),
	(101, 0, 44, '2015-03-17', 5, 100, 10, 'Da ich großen Bierdurst habe benötige ich Nachschub.\r\nKönnen danach gerne noch einen heben gehen :-)', 6, 1, 'Egal', NULL, 0, 0, NULL),
	(102, 0, 45, '2015-03-18', 2, 500, 50, 'Hey, kann mir Jemand Sachen aus dem Baumarkt besorgen?\r\nIch muss renovieren und benötige daher:\r\n- Farbe\r\n- Eimer\r\n- Pinsel\r\n- neues Waschbecken\r\n- Waschmaschine', 2, 1, 'Verschiedenes', NULL, 0, 0, NULL),
	(103, 0, 46, '2015-03-02', 5, 10, 10, 'GOOGLE "Candy Crush"', 1, 1, 'Versteh ich nicht', NULL, 0, 0, NULL),
	(104, 0, 47, '2015-03-16', 1, 20, 1, 'Hallo,\r\nim Aldi gibt es Schinkenwurst im Angebot, hätte gerne einen Berg davon zum Einfrieren.\r\n\r\nDANKE!', 1, 1, 'Aldi', NULL, 0, 0, NULL),
	(105, 0, 48, '2015-03-22', 5, 100, 20, 'Suche Rinderfilet, das BESTE der Stadt!!', 6, 1, 'Egal', NULL, 0, 0, NULL),
	(106, 0, 49, '2015-03-24', 2, 75, 5, 'Hallo,\r\nNudeln, Pesto, Käse, Reis, Fleisch, vieeel Schokolade und 3x Weißwein für mich bitte', 1, 1, 'ReWe', NULL, 0, 0, 0),
	(107, 0, 45, '2015-02-26', 1, 100, 50, 'Hey, hilft mir Jemand einen Schrank zu kaufen und zu tragen?', 1, 1, 'ReWe', NULL, 0, 0, NULL),
	(108, 1, 45, '2015-02-26', 5, 25, 2, 'Brauche einen Kasten Bier und Tiefkühl-Schnitzel. Oh, und eine Flasche Jägermeister!', 1, 1, 'ReWe', 42, 1, 1, 3),
	(109, 0, 46, '2015-02-20', 1, 5, 1, 'Ich habe Hunger, kann mir Jemand Brötchen bringen?', 5, 1, 'egal', NULL, 0, 0, NULL),
	(110, 1, 46, '2015-02-19', 4, 15, 2, 'Ich brauch paar Frikadellen...', 6, 1, 'Metzger ums Eck', 42, 1, 0, 4),
	(111, 0, 42, '2015-03-20', 5, 150, 20, 'Ich feier eine mega WG Party!! Hilft wer beim Bier tragen?', 1, 1, 'egal', NULL, 0, 0, NULL),
	(112, 0, 42, '2015-03-01', 5, 100, 5, 'Muss eine neue Hütte für den Hund abholen... ', 4, 1, 'Keiner', NULL, 0, 0, 0),
	(113, 1, 42, '2015-03-03', 2, 25, 2.5, 'Hi, kauft mir Jemand bitte ganz viele Tiefkühlpizzen?', 1, 1, 'ReWe', 42, 1, 1, 0);
